import {SET_SEARCH_RESULT} from './action';

const INITIAL_STATE ={
    searchResult:[]
}

export default function (state=INITIAL_STATE,action){
    if(action.type=== SET_SEARCH_RESULT){
        return {
            ...state,
            SearchItem: []
        }
    }
    else{
        return  {SearchItem: INITIAL_STATE}
    }
}
